import NavBar from '../Nav-Bar';
import Header from '../Header';
import './First_Entry.css';
import csv_nav from 'jasons_website/src/components/images/csv_nav.'

const FirstEntry = () => {
    return (
        <body>
            <Header></Header>
            <NavBar></NavBar>
            <div className="blog container ">
                <div className="header p-5 mt-5 justify-content-center">
                    <h1>First Entry</h1>
                    <h3>09/08/2021</h3>
                    <h2>Interactive Category Selection</h2>
                    <img src={csv_nav} />
                </div>
            </div>

        </body>
    );
}

export default FirstEntry
